    //------------------------------------------------------
    // A SINGLE FUNCTION THAT DEFINES THE WIDGET'S PROTOTYPE
    //------------------------------------------------------
    
    function( PROTOTYPE, WIDGET )
    {  
      var
         widgetStatus = WIDGET.Completed;
    
      if ( !window.LONGRANGE )
      {
        // Longrange hasn't finished loading yet
        widgetStatus = WIDGET.Loading;
        
        // Finalize the widget definition when it does
        window.onLongRangeReady = WIDGET.Finalize;
      }
    
      //--------------------------------------------------------
      // WIDGET-INTERFACE FUNCTIONS (CALLED FROM THE VL-RUNTIME)
      //--------------------------------------------------------
    
      //
      // 'onCreateInstance' - gets called when LANSA creates an instance of the widget.
      //
      PROTOTYPE.onCreateInstance = function()
      {
      }
    
      //------------------------
      // PROPERTY IMPLEMENTATION
      //------------------------
    
      PROTOTYPE.getFileName = function()
      {
        return this.m_FileName;
      }
      PROTOTYPE.setFileName = function( strValue )
      {
        this.m_FileName = strValue;
      }
    
      //----------------------
      // METHOD IMPLEMENTATION
      //----------------------
    
      // 
      // Delete
      // 
      // Returns:
      //   "OK" = File save has been called
      //
      PROTOTYPE.Delete = function()
      {
        var pThis = this;
        var options = { };
    
        options.file = this.m_FileName;
        options.fileMustExist = true;
    
        // Set the function to handle the onCompleted event.
        options.onCompleted = function( result )
        {
          var message = "";
          if ( result.message )
          {
            message = result.message;
          }
          pThis.fireCompleted( LongRangeToVLStatusCodes( result.status ), message );
        };
    
        LONGRANGE.LocalFiles.deleteFile(options);
    
        return "OK";
      }
    
      //---------------------
      // ADDITIONAL FUNCTIONS
      //---------------------
    
      function LongRangeToVLStatusCodes( lrStatus )
      {
        var
          vlStatus = "";
    
        if ( lrStatus == LONGRANGE.Status.Ok )
        {
          vlStatus = "OK";
        }
        else if ( lrStatus == LONGRANGE.Status.Cancelled )
        {
          vlStatus = "CAN";
        }
        else if ( lrStatus == LONGRANGE.Status.Error )
        {
          vlStatus = "ER";
        }
        else
        {
          vlStatus = "UNK";
        }
    
        return vlStatus;
      }
    
      return widgetStatus;
    }

